        $str9$Dictionary_Assistant = SubLObjectFactory.makeString("Dictionary Assistant");
        $str10$Welcome_to_the_Subject_Matter_Exp = SubLObjectFactory.makeString("Welcome to the Subject Matter Expert Lexification Wizard (SME LexWiz for short). The wizard will ask you a series of questions so that it can determine how to best represent a phrase use to refer to a given concept. This process is called lexification since lexical properties of the phrase are ascertained, such as its grammatical category.\n\nBefore proceeding, the utility must first be initialized. For instance, example lexifications will be retrieved from the knolwledge base for illustrative purposes.");
        $str11$The_initialization_may_take_sever = SubLObjectFactory.makeString("The initialization may take several minutes, depending upon your system, but it needs to be performed only once, at startup.");
        $str12$Choose_a_phrase_that_clearly_dist = SubLObjectFactory.makeString("Choose a phrase that clearly distinguishes the Cyc term in question, yet reflects common ways of referring to the term. However, it is important to avoid being overly specific as well as being overly general.\n\nFor example, for the term 'MakingCoffee-TheBeverage', the phrase \"making a coffee beverage\" is overly precise. Instead, \"making coffee\" is preferred since \"coffee\" in this phrase only refers to the beverage, and not for instance to the beans or to grounds. In contrast, for the term 'Paint-Dry', \"paint\" would be overly general, since this can also refer to liquid paint as well. Instead \"dry paint\" would be preferable.\n\nIf you want to use more than one word or phrase to refer to the term, complete the wizard for the current term and then begin again with the same term, but with a different word or phrase.");
        $str13$Normally__capitalized_phrases_are = SubLObjectFactory.makeString("Normally, capitalized phrases are proper names. Some lowercase phrases may be proper names as well; those which refer to specific people (e.g., \"e. e. cummings\") or entities (e.g., \"priceline.com\"), or those which are scientific names for specific organisms, compounds, etc. (e.g., \"plexus brachialis\"). But in most cases, lowercase phrases refer to classes of individuals and to concepts rather than to specific individuals.\n\nExample proper names (particular individuals):\n\tMother Teresa\n\tIBM\n\tAcquired Immune Deficiency Syndrome\n\nExample common nouns or phrases (categories):\n\tcat\n\tthing\n\tNissan car");
        $str14$examples____video_sports_game____ = SubLObjectFactory.makeString("examples:\n\t\"video sports game\" => \"game\"\n\t\"load a weapon\" => \"load\"\n\t\"soccer arena in the Netherlands\" => \"arena\"\n\nNote: The headword will undergo inflectional changes, such as for pluralization. For example, pluralizing the above phrases only affects the headword: \"video sports games\", \"loads a weapon\", and \"soccer arenas in the Netherlands\".");
        $str15$The_headword_is_the_word_that_is_ = SubLObjectFactory.makeString("The headword is the word that is being qualified by the other words in the phrase. It often indicates the general class of the concept described by the phrase. And, it determines the grammatic function of the phrase.\n\nFor example, in the noun phrase \"metal desk\", the noun \"desk\" is the headword qualified by \"metal\". Similarly, the verb \"sleeping\" is the headword of the verb phrases \"sleeping on the job\" and \"quietly sleeping\".");
        $str16$The_sentence_should_be_general_en = SubLObjectFactory.makeString("The sentence should be general enough to reflect common ways of referring to the relation, but it should be specific enough to avoid confusion with similar relations. A case of being too general would be the following as a sample for the 'hasPets' relation:\n\tJohn has a doberman.\nThis would not distinguish the relation from other has-type relations, such as 'hasStyle' (consider \"John has a crew cut\"). On the otherhand, the following would be too specific:\n\tJohn cares for, feeds, and provides shelter for a doberman.\nInstead, the following would be better than either:\n\tJohn's pet is a doberman.\n\nAnother example of the right level of generality would be the following sample sentence for the relation 'infectionTypeTransmittedDuring':\n\tThe infection anthrax is transmitted during contact with infected animals.\nNote that although 'infection anthrax' might seem redundant, this helps distinguish this from other forms of transmission, such as electronic communications (consider \"The e-mail is transmitted during the evening\").");
        $str17$The_choices_for_the_phrasal_part_ = SubLObjectFactory.makeString("The choices for the phrasal part of speech correspond to the traditional grammatic categories\n\tNoun: refers to a person, place, thing, etc. (e.g., open '[the door]')\n\tVerbal: refers to an action, process, state of being, etc. (e.g., [close] the window)\n\tAdjectival: generally used to modify noun phrases (e.g., '[fast] cars')\n\tAdverbial: generally used to modify verb phrases (e.g., 'sleep [deeply]')\n\tPrepositional: relational phrase starting with preposition (e.g., 'sleeping [in the park])");
